import React from 'react';
import { FormControl, InputGroup,Button } from 'react-bootstrap';

const SearchBox = ({ onChangeSearch }) => {
	return (
		// <Form inline style={{ width: '50%' }}>
		// 	<FormControl type="text" placeholder="Search" className="mr-sm-2" style={{ width: '75%' }} onChange={onChangeSearch} />
		// </Form>
		<InputGroup inline style={{ width: '50%' }}>
			<FormControl
				placeholder="What are you looking for?"
			/>
			<InputGroup.Append>
				<Button variant="outline-secondary">Search</Button>
			</InputGroup.Append>
		</InputGroup>
	)
}

export default SearchBox;
